There are several ways a web application can communicate between two browser tabs:

### 1. **Local Storage**

You can use the `localStorage` API to store data in one tab and retrieve it in another. This method is simple, but it has limitations, such as data size limits and the fact that data is not updated in real-time.

**Example:**
```javascript
// Tab 1
localStorage.setItem('data', 'Hello from Tab 1!');

// Tab 2
const data = localStorage.getItem('data');
console.log(data); // Output: "Hello from Tab 1!"
```
### 2. **Web Storage Events**

You can use the `storage` event to communicate between tabs. When data is stored in `localStorage` or `sessionStorage`, a `storage` event is fired in all other tabs that are listening for it.

**Example:**
```javascript
// Tab 1
localStorage.setItem('data', 'Hello from Tab 1!');

// Tab 2
window.addEventListener('storage', (event) => {
  if (event.key === 'data') {
    console.log(event.newValue); // Output: "Hello from Tab 1!"
  }
});

